import React from 'react';

interface props {
    content?: string | number;
    onClick?: () => void;
}
const bg = `bg-indigo-100`;
export const Button = ({ content, onClick }: props) => {
    return (
        <div>
            <button
                onClick={onClick}
                className={`truncate mx-2 py-2 px-6 ${bg} h-12 text-white bold font-medium rounded-md hover:bg-indigo-800 text-lg opacity-80 flex justify-center`}
            >
                {content ? content : 'button'}
            </button>
        </div>
    );
};
